function Validate(c){if(typeof(c)!="object"||c==null){return false}var d=[];if(c.name.substr(0,8)=="MESSAGES"){var b=c.getElementsByTagName("input");if(b&&typeof b=="object"){if(!b.length||(typeof(b.length)=="undefined")){b=[b]}var a=true;for(ii=0;ii<b.length;ii++){if(!(b[ii].type=="checkbox"&&b[ii].name=="message_id[]")){continue}if(b[ii].checked){a=false;break}}if(a){d.push(BX.message("no_data"))}}}if(c.ACTION.value==""){d.push(BX.message("no_action"))}if(d.length>0){alert(d.join("\n"));return false}if(c.ACTION.value=="DEL"){return confirm(BX.message("cdms"))}return true};